def checkport(ip, port, delay):
    a_socket = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
    a_socket.settimeout(delay)
    location = (ip, port)
    check = a_socket.connect_ex(location)
    if (check == 0):
        print(ip + " tem a porta " + str(port) + " aberta.")
    else:
        print(ip + " com a porta " + str(port) + " fechada.")
    return (check == 0)

def linkport(ip, port):
    icosize = "16px"
    if (int(port) == 80):
#        return "<a href='http://" + ip + "'>HTTP</a>"
        return "<a title='HTTP' href='http://" + ip + "'><img width=" + icosize + " src='data:image/png;base64,'></a>"
    elif (int(port) == 8080):
        return "<a title='HTTP' href='http://" + ip + ":'><img width=" + icosize + " src='data:image/png;base64,'></a>"
    elif (int(port) == 443):
        return "<a title='HTTPS' href='https://" + ip + "'><img width=" + icosize + " src='data:image/png;base64,'></a>"
    elif (int(port) == 631):
        return "<a title='Printer' href='http://" + ip + ":631'><img width=" + icosize + " src='data:image/png;base64,'></a>"
    elif (int(port) == 8006):
        return "<a title='Proxmox' href='https://" + ip + ":8006'><img width=" + icosize + " src='data:image/png;base64,'></a>"
    elif (int(port) == 9090):
        return "<a title='Cockpit' href='http://" + ip + ":9090'><img width=" + icosize + " src='data:image/png;base64,'></a>"
    else:
        return ip

