def netshow(net):
    list = prehtml + "<p>Varredura na rede " + net["network"] + "/24.</p><ul>"
    for h in net["hosts"]:
        sing = ""
        for p in h["ports"]:
            sing += linkport(h["host"], p)
        list += "<li>" + h["host"] + ": " + sing + "</li>"
    return list + "</ul><p>Varredura de " + net["scanned"] + ".</p>" + poshtml

def updatenet():
    cf = open(conffile, "w")
