@post('/save')
def savenet():
    netdata.append(json.loads(request.forms.get('network')))
    updatenet()
    redirect('/')

@post('/del')
def deletenet():
    del netdata[int(request.forms.get('network'))]
    updatenet()
    redirect('/')

@route('/load/<id>')
def loadnet(id):
    return netshow(netdata[int(id)]) + deleteform(id)

