def listnets():
    count = 0
    out = ""
    for i in netdata:
        out += " <a href='/load/" + str(count) + "'>" + i["network"] + "</a>"
        count += 1
    return out

@route('/<network>')
def scannet(network):
    netparts = network.split('.')
    thisnet = {"network": network, "scanned": str(datetime.datetime.now()), "hosts": []}
    for i in range(1,254):
        singadd = netparts[0] + "." + netparts[1] + "." + netparts[2] + "." + str(i)
        ports = []
        delay = 0.03
        if checkport(singadd, 80, delay):
            ports.append(80)
        if checkport(singadd, 8080, delay):
            ports.append(8080)
        if checkport(singadd, 443, delay):
            ports.append(443)
        if checkport(singadd, 631, delay):
            ports.append(631)
        if checkport(singadd, 8006, delay):
            ports.append(8006)
        if checkport(singadd, 9090, delay):
            ports.append(9090)
        if len(ports) > 0:
            thisnet["hosts"].append({"host": singadd, "ports": ports})
    return netshow(thisnet) + saveform(thisnet)

